// src/pages/MyListings.js
import React, { useState, useContext, useEffect } from 'react';
import axios from 'axios';
import { UserContext } from '../App';

const MyListings = () => {
  const { user } = useContext(UserContext);
  const [listings, setListings] = useState([]);
  const [products, setProducts] = useState([]);
  const [formData, setFormData] = useState({
    product: '',
    price: '',
    description: '',
    shippingOptions: 'Standard',
  });

  const fetchListings = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/trade-listings');
      const userListings = res.data.filter((l) => l.offeredBy === user.username);
      setListings(userListings);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchProducts = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/products');
      const userProducts = res.data.filter((p) => p.offeredBy === user.username);
      setProducts(userProducts);
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    fetchListings();
    fetchProducts();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/trade-listings', {
        ...formData,
        offeredBy: user.username,
      });
      fetchListings();
      setFormData({
        product: '',
        price: '',
        description: '',
        shippingOptions: 'Standard',
      });
    } catch (error) {
      alert(error.response.data.message || 'Error adding listing');
    }
  };

  return (
    <div>
      <h2 className="text-xl font-bold mb-4">My Trade Listings</h2>
      <form onSubmit={handleSubmit} className="mb-6">
        <div className="flex flex-col md:flex-row md:space-x-4">
          <select
            name="product"
            value={formData.product}
            onChange={handleChange}
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          >
            <option value="">Select Product</option>
            {products.map((p) => (
              <option key={p._id} value={p.name}>
                {p.name}
              </option>
            ))}
          </select>
          <input
            type="number"
            name="price"
            value={formData.price}
            onChange={handleChange}
            placeholder="Price"
            min="0"
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          />
          <select
            name="shippingOptions"
            value={formData.shippingOptions}
            onChange={handleChange}
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          >
            <option value="Standard">Standard</option>
            <option value="Express">Express</option>
            <option value="Pickup">Pickup</option>
          </select>
        </div>
        <textarea
          name="description"
          value={formData.description}
          onChange={handleChange}
          placeholder="Description"
          required
          className="mt-4 px-3 py-2 border rounded w-full"
        ></textarea>
        <button
          type="submit"
          className="mt-4 bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
        >
          Add Listing
        </button>
      </form>
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white">
          <thead>
            <tr>
              <th className="py-2">Product</th>
              <th className="py-2">Price</th>
              <th className="py-2">Shipping</th>
              <th className="py-2">Description</th>
              <th className="py-2">Created Date</th>
              <th className="py-2">Last Updated</th>
            </tr>
          </thead>
          <tbody>
            {listings.map((listing) => (
              <tr key={listing._id} className="text-center border-t">
                <td className="py-2">{listing.product}</td>
                <td className="py-2">${listing.price}</td>
                <td className="py-2">{listing.shippingOptions}</td>
                <td className="py-2">{listing.description}</td>
                <td className="py-2">{new Date(listing.createdDate).toLocaleString()}</td>
                <td className="py-2">{new Date(listing.lastUpdatedDate).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default MyListings;
